/*Table structure for table `t_qiniu_content` */

DROP TABLE IF EXISTS `t_qiniu_content`;

CREATE TABLE `t_qiniu_content` (
  `content_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `bucket` varchar(200) DEFAULT NULL COMMENT 'Bucket 识别符',
  `name` varchar(255) DEFAULT NULL COMMENT '文件名称',
  `size` varchar(10) DEFAULT NULL COMMENT '文件大小',
  `type` varchar(10) DEFAULT NULL COMMENT '文件类型：私有或公开',
  `url` varchar(250) DEFAULT NULL COMMENT '文件url',
  `suffix` varchar(20) DEFAULT NULL COMMENT '文件后缀',
  `update_time` datetime DEFAULT NULL COMMENT '上传或同步的时间',
  PRIMARY KEY (`content_id`) USING BTREE,
  UNIQUE KEY `uniq_name` (`name`)
