/*Table structure for table `t_thesis` */

DROP TABLE IF EXISTS `t_thesis`;

CREATE TABLE `t_thesis` (
  `thesis_id` varchar(25) NOT NULL COMMENT '论文ID',
  `title` varchar(50) NOT NULL COMMENT '标题',
  `introduction` varchar(255) DEFAULT NULL COMMENT '摘要',
  `paper_type` int(11) DEFAULT NULL COMMENT '论文类型(1核心/ 2普通）',
  `time` varchar(32) DEFAULT NULL COMMENT '更新时间',
  `url` varchar(255) DEFAULT NULL COMMENT '论文下载',
  `cost` double(10,2) DEFAULT NULL COMMENT '花费',
  `state` int(11) DEFAULT NULL COMMENT '状态（1进行中/2已完成）',
  `invoice` varchar(255) DEFAULT NULL COMMENT '发票',
  `reimbursement` int(11) DEFAULT NULL COMMENT '是否已报销（0否/1是）',
  PRIMARY KEY (`thesis_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='论文_任务表';

